import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import './StoreDashboard.css';

const StoreDashboard = ({ setIsAuthenticated }) => {
  const navigate = useNavigate();
  const user = JSON.parse(localStorage.getItem('user') || '{}');
  const [storeInfo, setStoreInfo] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  const handleLogout = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('user');
    if (setIsAuthenticated) setIsAuthenticated(false);
    navigate('/login');
  };

  useEffect(() => {
    const fetchStoreInfo = async () => {
      if (!user || !user.userName) {
        setError('User not found. Please login again.');
        return;
      }
      setLoading(true);
      setError('');
      try {
        const primaryUrl = `/api/stores/by-user/${encodeURIComponent(user.userName)}`;
        let response;
        try {
          response = await axios.get(`http://localhost:8080${primaryUrl}`);
        } catch (err) {
          // Fallback to alias endpoint if primary fails (e.g., 404 or path issue)
          const aliasUrl = `/api/stores/user/${encodeURIComponent(user.userName)}`;
          response = await axios.get(`http://localhost:8080${aliasUrl}`);
        }
        const stores = response?.data?.stores || [];
        setStoreInfo(stores);
        if (!response?.data?.success) {
          setError(response?.data?.message || 'Failed to load store info');
        }
      } catch (err) {
        console.error('Error fetching store info:', err);
        setError('Failed to fetch store info.');
        setStoreInfo([]);
      } finally {
        setLoading(false);
      }
    };

    // Only fetch for STORE_USER; admin dashboard shows general menus
    if (user?.role === 'STORE_USER') {
      fetchStoreInfo();
    }
  }, [user?.userName, user?.role]);

  const mappedStore = storeInfo && storeInfo.length > 0 ? storeInfo[0] : null;

  return (
    <div className="store-dashboard-container">
      <header className="store-dashboard-header">
        <div className="header-content">
          <h1>Store Dashboard</h1>
          <div className="user-info">
            <span className="user-name">Welcome, {user.userName || 'User'}!</span>
            <span className="user-role">{user.role ? `Role: ${user.role}` : ''}</span>
            <button onClick={handleLogout} className="logout-button">Logout</button>
          </div>
        </div>
      </header>

      {user?.role === 'STORE_USER' && (
        <div className="store-summary">
          {loading && <div className="message">Loading store info...</div>}
          {!loading && error && (
            <div className="message error">{error}</div>
          )}
          {!loading && !error && (
            mappedStore ? (
              <div className="store-card">
                <h2>{mappedStore.storeName}</h2>
                <p><strong>Code:</strong> {mappedStore.storeCode}</p>
                <p><strong>Address:</strong> {mappedStore.address || '—'}</p>
                <p><strong>City:</strong> {mappedStore.city || '—'}</p>
              </div>
            ) : (
              <div className="message">No store mapped to this user.</div>
            )
          )}
        </div>
      )}

      <main className="store-dashboard-main">
        <div className="menu-grid">

          <div className="menu-card" onClick={() => navigate('/transactions')}>
            <h3>Transaction</h3>
            <p>Perform store transactions (coming soon)</p>
            <button className="menu-btn">Open Transactions</button>
          </div>

          <div className="menu-card" onClick={() => navigate('/reports')}>
            <h3>Reports</h3>
            <p>View store and sales reports (coming soon)</p>
            <button className="menu-btn">View Reports</button>
          </div>
        </div>

        {/* Removed back-to-admin button as requested */}
      </main>
    </div>
  );
};

export default StoreDashboard;
